import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import { useDispatch, useSelector } from "react-redux";
import setqty from '../../Redux/Cardprice/ItemQty';
import { additem } from '../../Redux/Cardprice/PriceAddAction';
import { deletitem } from '../../Redux/Cardprice/PriceDeleteAction';
import { Chip, Typography } from '@mui/joy';
import ShoppingCartIcon from '@mui/icons-material/ShoppingCart';
import IncDecButton from '../IncDecButton/IncDecButton';
import { Button } from '@mui/material';
import RemoveIcon from '@mui/icons-material/Remove';
import AddIcon from '@mui/icons-material/Add';
import { useState } from 'react';
import axios from 'axios';
const DropDown = (props) => {
    let numOfItem = useSelector(state => state.price.numOfItem)
    let ItemPrice = useSelector(state => state.price.totalPrice)
    let quantity = useSelector(state => state.price.qty)

    let dispatch = useDispatch()




    const [datakey, setdatakey] = React.useState([])
    const [num, setNum] = React.useState(1)
    const [qty, setQty] = React.useState('');
    const [itemnum, setItemnum] = React.useState(1)
    const [cartclicked, setcartclicked] = React.useState(false)
    const [pluse, setpluse] = useState(false)
    const [minus, setminus] = useState(false)

    React.useEffect(
        () => {
            setdatakey(Object.keys(props.list[0]))
            console.log(props.tocart, "aaaa")
            setQty(Object.keys(props.list[0])[0])

        }, []
    )

    React.useEffect(() => {
        dispatch(setqty(parseInt(props.list[0][qty]) * num * itemnum, qty, props.name, num))

    }, [cartclicked])

    const handleChange = (event) => {
        setcartclicked(false)
        setQty(event.target.value);


    };
    const handelcart = () => {

        let id = props.tocart._id
        setcartclicked(!cartclicked)
        console.log(id, "111");
        
        axios.post("localhost:8000/bachulars/addtocart", {
            userid: localStorage.getItem("login"), 
            cartitems:{
                id: { 
                    'CategoryName': props.tocart.CategoryName,
                    'img': props.tocart.img,
                    'name': props.tocart.name,
                    'type': qty,
                    "price": parseInt(props.list[0][qty] * num * itemnum)
                }

            }

        }
        )
    }

    return (
        <FormControl variant="standard" sx={{}}>
            <div style={{ display: 'flex', width: '100%', alignItems: 'center', flexDirection: 'column' }}>
                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'flex-start', width: '100%' }}> <Typography
                    level="title-lg"
                    sx={{ mt: 1, fontWeight: 'xl', minWidth: '60px' }} >

                    {props.list[0][qty] * num * itemnum} â‚¹
                </Typography><div style={{ marginRight: '20px' }}> <Button onClick={() => {
                    if (itemnum > 1) {
                        setpluse(false)
                        setminus(true)
                        setcartclicked(false)
                        setItemnum(p => p - 1)
                    }
                }} style={{ padding: '0px', minWidth: '45px' }}><RemoveIcon style={{ color: minus ? "green" : 'red' }} /></Button>{itemnum}<Button onClick={() => {
                    setcartclicked(false)
                    setminus(false)
                    setpluse(true)
                    setItemnum(p => p + 1)
                }} style={{ padding: '0px', minWidth: '45px' }}><AddIcon style={{ color: pluse ? "green" : 'red' }} /></Button></div></div>
                <div style={{ display: 'flex', justifyContent: 'space-between', width: '100%' }}>
                    <Select sx={{ width: '85px' }}
                        labelId="demo-simple-select-standard-label"
                        id="demo-simple-select-standard"
                        value={qty}
                        onChange={handleChange}
                        label="Age"
                    >
                        {datakey?.map((e, i) => {
                            return (<MenuItem key={i} value={e}>{e}</MenuItem>)
                        })}

                    </Select> <ShoppingCartIcon style={{ color: cartclicked ? "rgb(174 39 95)" : "black" }} onClick={handelcart}></ShoppingCartIcon></div>
            </div>
        </FormControl>
    )
}
export default DropDown
